import React from 'react';
import profPic from '../assets/profPic.png';
import { SlUser } from 'react-icons/sl';
import { SlSocialLinkedin } from 'react-icons/sl';
import { SlSocialGithub } from 'react-icons/sl';
import { SlSocialSpotify } from 'react-icons/sl';
import { LiaChevronDownSolid } from 'react-icons/lia';
import { LiaChevronUpSolid } from 'react-icons/lia';
import { Link } from 'react-router-dom';

import './Landing.css';

export default function Landing() {
   return (
      <div className='landing-content'>
         <Link to={``} className='navIcon chevronUp'>
            <LiaChevronUpSolid />
         </Link>
         <div className='bio-info'>
            <h1>Field Palmer</h1>
            <h4>Web Design & Development</h4>
            <hr className='hr-bar' />
            <h3 className='icons-list'>
               {/* <FaBeer /> */}
               <a href='#'>
                  <SlSocialLinkedin />
               </a>
               <a href='#'>
                  <SlSocialGithub />
               </a>
               <a href='#'>
                  <SlUser />
               </a>
               <a href='#'>
                  <SlSocialSpotify />
               </a>
            </h3>
            <hr className='hr-bar' />
         </div>
         <div className='profile-picture'>
            <span className='circle-image'>
               {/* <img alt='profPic' src='https://placehold.co/300' /> */}
               <img alt='profPic' src={profPic} />
            </span>
         </div>
         <span className='navIcon chevronDown'>
            <LiaChevronDownSolid />
         </span>
      </div>
   );
}
